import React, { Component } from 'react';
import '../../App.css';

export default class Collection extends Component {

    render() { 
        console.log(this.props.collection)
        return( 
            <div className="Collection">
                {this.props.collection.length > 0 &&
                    <div className="collection-container">
                        <div className="collection-box">
                            <img src={this.props.collection[4].collectionBanner} alt=""></img>
                            <div className="collection-overlay flex-center">
                                <div className="collection-title">{this.props.collection[4].collectionName.toLowerCase()}</div>
                                <div className="collection-link">Discover Now</div>
                            </div>
                        </div>
                        <div className="collection-box">
                            <img src={this.props.collection[5].collectionBanner} alt=""></img>
                            <div className="collection-overlay flex-center">
                                <div className="collection-title">{this.props.collection[5].collectionName.toLowerCase()}</div>
                                <div className="collection-link">Discover Now</div>
                            </div>
                        </div>
                    </div>
                }
            </div>
        )
    }
}
